import React, { useEffect, useState } from "react";
import axios from "axios"
import { useNavigate, Link, Form } from "react-router-dom";
import "./Login.css";

export default function Login() {
  const [activeForm, setActiveForm] = useState("signUp");
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");



  // async function setActiveForm(e){
  //   e.preventDefault();

  //   try{

  //     await axios.post("http://localhost:3000/",{
  //       method: "POST",
  //       body: JSON.stringify({
  //         email: email,
  //         password: password
  //       })
  //     });
  //   }
  //   catch(e){
  //     console.log(e);

  //   }
  // }


  async function signUpClick(e){
    e.preventDefault();

    try{

      await axios.post("http://localhost:4000/signup",{
        method: "POST",
        body: JSON.stringify({
          name: name,
          email: email,
          password: password
        })
      })
    }
    catch(e){
      console.log(e);

    }
  }


  // const signUpClick = () => {
  //   setActiveForm("signUp");
  // };

  return (
    <div>
      <div class="container">
        <div id="quizzieBox">
          <h1>Quizzie</h1>

          <div className="slides">
            <div class="slidesHead">
              <div className="inline">
                <button
                  id="signUpButton"
                  onClick={signUpClick}
                  class={activeForm === "signUp" ? "activeButton" : ""}
                >
                  Sign Up
                </button>
              </div>
              <div className="inline">
                <button
                  id="logInButton"
                  onClick={() => setActiveForm("logIn")}
                  class={activeForm === "logIn" ? "activeButton" : ""}
                >
                  Log In
                </button>
              </div>
            </div>

            <div class="slidesBody">
              {activeForm === "logIn" && (
                <div class="logIn inline">
                  <div>
                    <p class="inline emailin">Email</p>
                     <input type="email" value={email} onChange={(e) => { setEmail(e.target.value)}}></input>
                  </div>
                  <div>
                    <p class="inline passin">Password</p>
                     <input type="password" value={password} onChange={(e) => { setPassword(e.target.value)}}></input>
                  </div>
                  <div>
                    <Link to="/dashboard">
                      <button type="submit" className="blueButton">log In</button>
                    </Link>
                  </div>
                </div>
              )}
              {activeForm === "signUp" && (
                <div class="inline signUp">
                  <div>
                    <p class="inline name">Name</p>
                    <input type="name" value={name} onChange={(e) => { setName(e.target.value)}}></input>
                  </div>
                  <div>
                    <p class="inline email">Email</p>
                    <input type="email" value={email} onChange={(e) => { setEmail(e.target.value)}}></input>
                  </div>
                  <div>
                    <p class="inline pass">Password</p>
                    <input type="password" value={password} onChange={(e) => { setPassword(e.target.value)}}></input>
                  </div>
                  <div>
                    <p class="inline confpass">Confirm Password</p>
                    <input class="inline"></input>
                  </div>
                  <div>
                    <button type="submit" className="blueButton" onClick={() => setActiveForm("logIn")}>Sign Up</button>
                  </div>
                </div>
              )}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}




